## 模板功能说明

n8n终极爬虫模板通过Selenium与人工智能技术，可提取网页上显示的任何信息。您还可以使用会话cookie登录目标网页，满足更高级的数据抓取需求。

⚠️ 重要提示：本项目需要特定配置步骤，请严格遵循GitHub仓库中的指南操作：n8n终极爬虫配置手册 <https://github.com/Touxan/n8n-ultimate-scraper/tree/main>

请注意：n8n平台上的工作流版本可能与GitHub项目存在差异，但GitHub仓库中的版本始终是最新版本：<https://github.com/Touxan/n8n-ultimate-scraper/tree/main>

## 使用指南

部署项目并安装所有依赖后，向您的webhook发送请求。

**请求示例**：


    curl -X POST http://localhost:5678/webhook-test/yourwebhookid \
    -H "Content-Type: application/json" \
    -d '{
      "subject": "Hugging Face",
      "Url": "github.com",
      "Target data": [
        {
          "DataName": "Followers",
          "description": "GitHub主页的关注者数量"
        },
        {
          "DataName": "Total Stars",
          "description": "各代码仓库获得的星标总数"
        }
      ],
      "cookie": []
    }'


若仅需抓取网页数据：


