        "content": "## N8N终极爬虫 - 工作流\n\n本工作流旨在从任意网页采集数据，无论目标网站是否需要登录。\n\n例如，您可以采集GitHub上n8n-ultimate-scraper项目的星标数量。\n\n## 必备条件\n**Selenium容器**：Selenium是开源的Web应用自动化框架，支持通过多种编程语言脚本控制浏览器交互。\n您可以通过GitHub项目中的Docker Compose文件部署Selenium容器及配置：https://github.com/Touxan/n8n-ultimate-scraper\n\n**住宅代理服务器**：为避免大规模采集时被封锁，我个人推荐GeoNode。他们提供性价比极高的优质住宅代理：https://geonode.com/invite/98895\n\n**OpenAI API密钥**：用于调用GPT-4。\n\n## 可选配置\n会话Cookie采集：如需使用n8n终极爬虫的登录功能，需先采集目标网站的会话Cookie。您可通过GitHub项目中为此应用开发的扩展程序实现：https://github.com/Touxan/n8n-ultimate-scraper 请按安装说明操作。\n\n## 使用方法\n部署项目并满足所有要求后，向您的webhook发送请求。\n\n**请求示例**：\ncurl -X POST http://localhost:5678/webhook-test/yourwebhookid \\\n-H \"Content-Type: application/json\" \\\n-d '{\n  \"subject\": \"Hugging Face\",\n  \"Url\": \"github.com\",\n  \"Target data\": [\n    {\n      \"DataName\": \"Followers\",\n      \"description\": \"GitHub页面的关注者数量\"\n    },\n    {\n      \"DataName\": \"Total Stars\",\n      \"description\": \"不同仓库的星标总数\"\n    }\n  ],\n  \"cookies\": []\n}'\n\n也可直接采集链接：\ncurl -X POST http://localhost:5678/webhook-test/67d77918-2d5b-48c1-ae73-2004b32125f0 \\\n-H \"Content-Type: application/json\" \\\n-d '{\n  \"Target Url\": \"https://github.com\",\n  \"Target data\": [\n    {\n      \"DataName\": \"Followers\",\n      \"description\": \"GitHub页面的关注者数量\"\n    },\n    {\n      \"DataName\": \"Total Stars\",\n      \"description\": \"不同仓库的星标总数\"\n    }\n]\n}'\n\n**注意**\n单次请求最多支持5个目标数据采集项。"
